import React , {useState} from 'react'
import './Matches.css';

function Sentiago(){


    const [sentiage , setSentiage ]= useState(false) ;


    return( 
        <>
              <button onClick={ ()=>setSentiage(!sentiage)     }  className="court-name" >
              Sentiago
              </button>
     
     
          
      {
              sentiage?     <div className="star-table">
                             
                            </div>

           :null
          }
          
      </>

      
      
    )

    


    

    
    
}export default Sentiago ;
